const kampretdata = '';


const kampretData = atob(kampretdata);
var decodeContent = kampretData;


function isNumeric(value) {
    return /^-?\d+$/.test(value);
}

function decodeVar2(name){
    cd = new RegExp(`${name}\\([0-9]+, '[0-9a-zA-Z]+'\\)`, "g");
        
    decodeContent = decodeContent.replace(cd, (match, capture) => {
        
        evastr = match.replace(name, 'window.test_key');
        decodedKey = eval(evastr);

        return "'" + decodedKey + "'";
    });
}

function decodeVar(name){

    

    var keysource = new RegExp(`var ([a-zA-Z0-9]+) = ${name}`, "g");
    var data = decodeContent.match(keysource);

    data.forEach(function(keyfunc){

        key = keyfunc.split(' ')[1];
        cd = new RegExp(`${key}\\([0-9]+, '[0-9a-zA-Z]+'\\)`, "g");
        
        decodeContent = decodeContent.replace(cd, (match, capture) => {
            
            evastr = match.replace(key, 'window.test_key');
            decodedKey = eval(evastr);

            return decodedKey;
        });
        
       
    });

}

function extractDecoderKey(){
    rex = /function(\s[a-zA-Z0-9]+)?\(([a-zA-Z0-9\,\s]+)?\) \{([\r\n][\s]+'use strict\'\;)?[\r\n][\s]+var ([a-zA-Z0-9]+) \= ([a-zA-Z0-9]+)/gm
    keys = kampretData.match(rex);

    decoder_keys = keys.map(key => {
        lines = key.split('\n');
        line = lines[1].trim();
        line = line.replace('var', '').replace(';', '').trim().split(' = ')

        return line;
        
    }).filter(line => !isNumeric(line[1]));
    
    return decoder_keys;

}


setTimeout(function() {
    decoder_key = extractDecoderKey();

    decoder_key.forEach(key => decodeVar2(key[0]));


    // console.log('decodeContent', decodeContent);
}, 9000);


